import React from "react";
import "./style.css";
import { Images } from "../../config/image";
function login() {
  return (
    <div>
      <div className="form-login">
        <div className="form-box">
          <div style={{ display: "block" }}>
            <div className="sign-in">ĐĂNG NHẬP</div>
            <div>Tên đăng nhập</div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default login;
